import GlobalNav from "./GlobalNav";

function Header(){
    return (
        <header>
            <img src="http://placekitten.com/100/100" alt="logo cat picture" />
            <h1>Welcome to the cat's home</h1>
            <GlobalNav/>
        </header>
    );
}

export default Header;
